import React from "react";


class Table extends React.Component {
    render() {
        return (
            <>
                <h1>Table tag explained...</h1>
                <table>
                    <thead>
                        <tr>
                            <th>Serial Number</th>
                        </tr>
                    </thead>
                </table>
            </>
        )
    }
}

export default Table;
